import{_ as e,c as a,o as r,a4 as t}from"./chunks/framework.DRnJpP2i.js";const f=JSON.parse('{"title":"About Us","description":"","frontmatter":{},"headers":[],"relativePath":"about.md","filePath":"about.md"}'),i={name:"about.md"},o=t('<h1 id="about-us" tabindex="-1">About Us <a class="header-anchor" href="#about-us" aria-label="Permalink to &quot;About Us&quot;">​</a></h1><p>Welcome to the Hardware Lab at Computer Science and Engineering Department of National Institute of Technology, Calicut. We are a team of dedicated individuals who have come together to create a comprehensive resource for students studying computer hardware in the department.</p><h2 id="our-philosophy" tabindex="-1">Our Philosophy <a class="header-anchor" href="#our-philosophy" aria-label="Permalink to &quot;Our Philosophy&quot;">​</a></h2><p>Our mission is to provide students with a valuable tool that enhances their learning experience in the hardware lab course. We aim to simplify complex concepts, offer practical tips, and provide step-by-step guides to help students excel in their studies.</p><h2 id="the-computer-science-department" tabindex="-1">The Computer Science Department <a class="header-anchor" href="#the-computer-science-department" aria-label="Permalink to &quot;The Computer Science Department&quot;">​</a></h2><p>The Computer Science Department of NITC is a leading academic department that fosters innovation, research, and excellence in the field of computer science. Our department offers a wide range of courses and programs designed to equip students with the knowledge and skills required to thrive in the ever-evolving world of technology.For more information visit <a href="https://minerva.nitc.ac.in/" target="_blank" rel="noreferrer">https://minerva.nitc.ac.in/</a></p><h2 id="the-hardware-lab-course-guide-team" tabindex="-1"><strong>The Hardware Lab Course Guide Team</strong> <a class="header-anchor" href="#the-hardware-lab-course-guide-team" aria-label="Permalink to &quot;**The Hardware Lab Course Guide Team**&quot;">​</a></h2><h2 id="faculty-fontawesome-solid-computer" tabindex="-1"><strong>Faculty :fontawesome-solid-computer:</strong> <a class="header-anchor" href="#faculty-fontawesome-solid-computer" aria-label="Permalink to &quot;**Faculty :fontawesome-solid-computer:**&quot;">​</a></h2><ul><li><a href="http://people.cse.nitc.ac.in/srinivasa/" target="_blank" rel="noreferrer"><strong>Prof. Srinivasa TM</strong></a></li><li><a href="https://people.cse.nitc.ac.in/nirmal/" target="_blank" rel="noreferrer"><strong>Prof. Nirmal Kumar Boran</strong></a></li></ul><h3 id="the-mips-team-simple-linkedin" tabindex="-1">The MIPS Team :simple-linkedin: <a class="header-anchor" href="#the-mips-team-simple-linkedin" aria-label="Permalink to &quot;The MIPS Team :simple-linkedin:&quot;">​</a></h3><ul><li><a href="https://www.linkedin.com/in/mosaad2707/" target="_blank" rel="noreferrer">Mohammad Saad</a></li><li><a href="https://www.linkedin.com/in/naeem-niaz-670a141b8/" target="_blank" rel="noreferrer">Naeem Niaz</a></li><li><a href="https://www.linkedin.com/in/chandrakant-bellary-623a24244/" target="_blank" rel="noreferrer">Chandrakant V Bellary</a></li><li><a href="https://www.linkedin.com/in/myth64/" target="_blank" rel="noreferrer">Mithunraj M </a></li><li><a href="https://www.linkedin.com/in/abel-roy-813144279" target="_blank" rel="noreferrer">Abel Mani Roy</a></li></ul><h3 id="the-verilog-team-simple-linkedin" tabindex="-1">The Verilog Team :simple-linkedin: <a class="header-anchor" href="#the-verilog-team-simple-linkedin" aria-label="Permalink to &quot;The Verilog Team :simple-linkedin:&quot;">​</a></h3><ul><li><a href="http://www.linkedin.com/in/arshiya-padiyath-hafis-76237b230" target="_blank" rel="noreferrer">Arshiya P Hafis</a></li><li><a href="https://www.linkedin.com/in/avinash-kumar-228199230" target="_blank" rel="noreferrer">Avinash Kumar</a></li><li><a href="https://www.linkedin.com/in/akshit-kumar-444a28275" target="_blank" rel="noreferrer">Akshit Kumar</a></li><li><a href="https://www.linkedin.com/in/aritro-ghosh-437285223/" target="_blank" rel="noreferrer">Aritro Ghosh</a></li><li><a href="https://www.linkedin.com/in/arjun-krishna-b0aa12247" target="_blank" rel="noreferrer">Arjun Krishna</a></li></ul><h3 id="web-and-repository-maintenance-simple-github" tabindex="-1">Web and Repository Maintenance :simple-github: <a class="header-anchor" href="#web-and-repository-maintenance-simple-github" aria-label="Permalink to &quot;Web and Repository Maintenance :simple-github:&quot;">​</a></h3><ul><li><a href="https://github.com/mosaad2707" target="_blank" rel="noreferrer">Mohammad Saad</a></li><li><a href="https://github.com/AltoTenor" target="_blank" rel="noreferrer">Aritro Ghosh</a></li></ul><h2 id="join-our-team" tabindex="-1">Join Our Team <a class="header-anchor" href="#join-our-team" aria-label="Permalink to &quot;Join Our Team&quot;">​</a></h2><p>We are always looking to expand our team and welcome individuals who share our passion for computer hardware education. If you are interested in contributing to the Hardware Lab Course Guide or have any suggestions, we would love to hear from you. Please reach out to us at <a href="https://mail.google.com/mail/?view=cm&amp;fs=1&amp;to=hwlab_csed@nitc.ac.in" target="_blank" rel="noreferrer">hwlab_csed@nitc.ac.in :octicons-mail-16:</a></p><p>Thank you for visiting the Computer Science Department&#39;s Hardware Lab Course Guide. We hope this resource serves as a valuable tool for your studies and contributes to your success in the fascinating world of computer hardware.</p>',18),n=[o];function l(s,h,c,d,u,m){return r(),a("div",null,n)}const b=e(i,[["render",l]]);export{f as __pageData,b as default};
